            let fileName = this.value.replace(/^.*[\\\/]/, '').replace(/\.[^/.]+$/, """");
            let regex = new RegExp(regexForFile);
            let isFileNameValid = regex.test(fileName);
            if (!isFileNameValid) {
                $('#errorMessage').show();
                $('#errorMessage').text('Sorry document name not valid!');
            }
            else {
                $('#errorMessage').hide();
                $('#uploadButton').prop('disabled', false);
            }
        });

